    app.metadataCache.on('changed', (file) => {
        if (file.path === app.workspace.getActiveFile()?.path) {
            applyIconBasedOnStatus();
        }
    });

    app.workspace.on('file-open', applyIconBasedOnStatus);
};

// Initialize project management
